import React from "react";

interface IProps {
  url: string;
}

const ImageMessage: React.FC<IProps> = ({ url }) => {
  return <img alt="url" src={url} style={{maxWidth: "100%", minWidth:"100%"}}/>;
};

export default ImageMessage;
